// import package
import {
  BrowserRouter as Router,
  Route,
  Redirect,
  Switch
} from 'react-router-dom';
import Users from './user/pages/index'
//   import Axios from "axios"


// ที่รวม Routh ต่างๆ
const App = () => {
  return (
    
    <Router>
      <Switch>
        <Route path="/" >
            <Users/>
        </Route>
      </Switch>
    </Router>
    
  );
};

 export default App;
